import { format } from 'date-fns'
import { useEffect, useState } from 'react'
import { useParams } from 'react-router-dom'
import Alert from '../components/Alert'
import Loading from '../components/Loading'
import { bookingAPI } from '../services/api'

const UserBookings = () => {
	const { roomNumber } = useParams()
	const [bookings, setBookings] = useState([])
	const [alert, setAlert] = useState({ type: '', message: '' })
	const [loading, setLoading] = useState(false)

	useEffect(() => {
		loadUserBookings()
	}, [roomNumber])

	const loadUserBookings = async () => {
		setLoading(true)
		try {
			const response = await bookingAPI.getUserBookings(roomNumber)
			setBookings(response.data.data)
		} catch (error) {
			showAlert('error', 'Bronlarni yuklashda xatolik')
		} finally {
			setLoading(false)
		}
	}

	const showAlert = (type, message) => {
		setAlert({ type, message })
		setTimeout(() => setAlert({ type: '', message: '' }), 5000)
	}

	const handleDeleteBooking = async id => {
		if (!window.confirm('Bronni bekor qilishni istaysizmi?')) return

		try {
			await bookingAPI.delete(id)
			showAlert('success', 'Bron muvaffaqiyatli bekor qilindi')
			loadUserBookings()
		} catch (error) {
			showAlert('error', 'Bronni bekor qilishda xatolik')
		}
	}

	if (loading) return <Loading />

	return (
		<div className='container'>
			<div className='hero'>
				<h1>Mening Bronlarim</h1>
				<p>Xona: {roomNumber}</p>
			</div>

			<Alert type={alert.type} message={alert.message} />

			<div className='form-container'>
				{bookings.length === 0 ? (
					<div style={{ textAlign: 'center', padding: '2rem' }}>
						<h3>Sizda bronlar mavjud emas</h3>
						<p>Bosh sahifaga qaytib yangi bron qiling</p>
						<a href='/' className='btn' style={{ marginTop: '1rem' }}>
							Bosh Sahifa
						</a>
					</div>
				) : (
					<>
						<h2>Bronlar Ro'yxati</h2>
						<table className='table'>
							<thead>
								<tr>
									<th>Sana</th>
									<th>Vaqt</th>
									<th>Mashina</th>
									<th>Bron Qilingan Sana</th>
									<th>Amallar</th>
								</tr>
							</thead>
							<tbody>
								{bookings.map(booking => (
									<tr key={booking.id}>
										<td>
											{format(new Date(booking.booking_date), 'dd.MM.yyyy')}
										</td>
										<td>{booking.time_slot}</td>
										<td>{booking.machine_name}</td>
										<td>
											{format(new Date(booking.created_at), 'dd.MM.yyyy HH:mm')}
										</td>
										<td>
											<button
												onClick={() => handleDeleteBooking(booking.id)}
												className='btn btn-danger'
												style={{ padding: '0.5rem 1rem', fontSize: '0.9rem' }}
											>
												Bekor Qilish
											</button>
										</td>
									</tr>
								))}
							</tbody>
						</table>
					</>
				)}
			</div>
		</div>
	)
}

export default UserBookings
